const LoginPage = () => {
  return (
    <main className="mw login">
      <h2>로그인</h2>
      <main className={`mw ${style.register}`}>
        <h2>회원가입 페이지</h2>

        <form className="registercon">
          <input type="text" placeholder="아이디" />
          <input type="password" placeholder="패스워드" />
          {/* <input type="password" placeholder="패스워드 확인" /> */}
          <button type="submit">가입하기</button>
        </form>

        <p>
          이미 회원가입 되었나요? <Link to="/login">로그인</Link>
        </p>
      </main>
    </main>
  );
};

export default LoginPage;
